   <head>
      <title>BWUnit&trade; Copyright Notice</title><style type="text/css">
html, body, div, span, applet, object, iframe,
h1, h2, h3, h4, h5, h6, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, font, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
dl, dt, dd, ol, ul, li,
fieldset, form, label, legend,
table, caption, tbody, tfoot, thead, tr, th, td {
	margin: 0;
	padding: 0;
	border: 0;
	outline: 0;
	font-weight: inherit;
	font-style: inherit;
	font-size: 100%;
	font-family: inherit;
	vertical-align: baseline;
	background: transparent;
}
/* remember to define focus styles! */
:focus {
	outline: 0;
}
body {
	line-height: 1;
	color: black;
	background: white;
}
ol, ul {
	list-style: none;
}
/* tables still need 'cellspacing="0"' in the markup */
table {
	border-collapse: collapse;
	border-spacing: 0;
	width: 100%;
}
table table {
	margin: 0;
}

caption, th, td {
	text-align: left;
	font-weight: normal;
}
blockquote:before, blockquote:after,
q:before, q:after {
	content: "";
}
blockquote, q {
	quotes: "" "";
}

body { 
	font-family: 'Helvetica Neue', Helvetica, Arial, sans-serif;
	font-size: 0.9em;
	margin: 0px;
	padding: 0px;
	background-repeat: no-repeat;
	background-attachment: fixed;
	background-position: 170% 100%;
}

#container {
	padding: 25px;
	margin: 25px auto;
	background: rgba(244,244,244,0.7);
	width: 80%;
	box-shadow: 0 3px 4px rgba(0, 0, 0, 0.3);
	-moz-box-shadow: 0 3px 4px rgba(0, 0, 0, 0.3);
	-webkit-box-shadow: 0 3px 4px rgba(0, 0, 0, 0.3);
	margin-bottom: 25px;
	-moz-border-radius: 15px;
	-webkit-border-radius: 15px;
	border-radius: 15px;
}

th {
	background: black; color: white; text-align: center;
	padding: 4px;
	font-weight: bold;
	text-align: left;
}

td {
	padding: 2px 4px;
	border-right: 1px solid #ddd;
}

tbody, thead { 
	border: solid black 4px; 
}

table table tbody, table table thead {
	border-right: none;
}

tr.alt { background: rgba(0,0,0,0.06); }

tr.fail, tr.error-code, tr.process-stack, tr.stack-trace, tr.error-detail  { 
	background:  rgba(255,0,0,0.07);
}

tr.summary-fail {
	background: rgba(255,0,0,0.03);
	border-top: 1px solid #ff0000 !important;
	border-bottom: 1px solid #ff0000 !important;
}

tr.fail.alt, tr.error-message, tr.error-class, tr.error-data, tr.error-detail.alt { 
	background: rgba(255,0,0,0.03);
}

tr.fail td, tr.error-code td, tr.process-stack td, tr.stack-trace td, tr.fail.alt td, tr.error-message td, tr.error-class td, tr.error-data td, tr.summary-fail td  { 
	border-right: 0;
	border-top: 1px solid #ff0000 !important;
}

tr.summary-fail td  { 
	border-bottom: 1px solid #ff0000 !important;
}

tr.fail th, tr.error-code th, tr.process-stack th, tr.stack-trace th, tr.fail.alt th, tr.error-message th, tr.error-class th, tr.error-data th, tr.summary-fail th {
	border-top: 0 !important;
	border-bottom: 0 !important;
}

tr.total {
	border-bottom: 2px solid #ddd;
}

tr.total td {font-weight: bold !important;}

div.logo { 
	width: 223px; height: 67px;
	margin: 40px auto -120px;
	border: none;
	box-shadow: 0 3px 4px rgba(0, 0, 0, 0.3);
	-moz-box-shadow: 0 3px 4px rgba(0, 0, 0, 0.3);
	-webkit-box-shadow: 0 3px 4px rgba(0, 0, 0, 0.3);
	-moz-border-radius: 15px;
	-webkit-border-radius: 15px;
	border-radius: 15px;
	padding: 10px 5px 5px 5px;
	background-color: #fff;
	background-position: center;
	background-repeat: no-repeat;
}


div.logo a { 
	display: block;
	width: 223px; height: 67px;
	text-indent: -99999em;
}

h1 {
	font-size: 2em;
	font-weight: bold;
	padding: 20px 0 20px 25px;
	margin: -25px -25px -10px;
	text-shadow: #fff 1px 1px 0;
	background: #FFFF88;
	-moz-border-radius-topright: 15px;
	-webkit-border-top-right-radius: 15px;
	-moz-border-radius-topleft: 15px;
	-webkit-border-top-left-radius: 15px;
	border-bottom: 1px solid #ddd;
}

h2 {
	margin: 40px 0 10px;
	padding-top: 10px;
	font-weight: bold;
	font-size: 1.3em;
}

pre {
	font-family: "Courier", monospace;
	overflow: auto;
}

td.error-detail {
	padding: 0;
	border-bottom: 1px solid rgb(255, 0, 0) !important;
}


td.error-detail table {
	table-layout: fixed;
	width: 95%;
	margin-left: auto;
}

td.error-detail table td {
	overflow: auto;
}

table.detail, table.summary {
	table-layout: fixed;
}

table.detail td, table.detail th {
	width: 10%;
}


table.detail td:first-child, table.detail th:first-child, table.summary td:first-child, table.summary th:first-child  {
	width: 60%;
	overflow: auto;
}

table.detail td.error-detail table th, table.detail td.error-detail table th:first-child {
	text-align: right;
	padding-right: 10px;
	border-top: solid white 1px !important;
	width: 20%;
}

table.detail td.error-detail table td {
	width: 80%;
}
